INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カリン", 118501, 787, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 0, 0, "2021/10/19 12:00:00", 118501, 2.0, 118501, 450, 1, 118501, 1, 0, 2, "かりん", 37, 0, 0, 0, 0, "2030/12/31 15:00:00", 37);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネビア", 118601, 826, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 0, "2024/08/10 21:00:00", 118601, 2.0, 118601, 450, 1, 118601, 3, 0, 2, "ねびあ", 0, 0, 0, 0, 0, "2030/12/31 15:00:00", 0);
