INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マヒル（クリスマス）", 119201, 397, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 0, 5, "2023/09/19 15:00:00", 119201, 2.19, 119201, 450, 1, 119201, 1, 0, 1, "まひる", 6, 0, 0, 0, 0, "2030/12/31 15:00:00", 6);
