INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シェフィ（ニューイヤー）", 120701, 283, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, 1, "2024/01/26 12:00:00", 120701, 1.84, 120701, 450, 1, 120701, 3, 0, 1, "しぇふぃ", 4, 0, 0, 0, 0, "2024/01/31 11:59:59", 22);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ルカ（ニューイヤー）", 120801, 193, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, 2, "2023/10/16 15:00:00", 120801, 1.3, 120801, 450, 1, 120801, 1, 0, 1, "るか", 4, 0, 0, 0, 0, "2030/12/31 15:00:00", 22);
