INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ペコリーヌ（オーバーロード）", 121001, 164, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, 1, "2024/02/22 12:00:00", 121001, 2.25, 121001, 450, 1, 121001, 3, 0, 1, "ぺこりーぬ", 5, 0, 0, 0, 0, "2024/02/29 11:59:59", 41);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キャル（オーバーロード）", 121101, 588, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, 1, "2024/02/22 12:00:00", 121101, 2.07, 121101, 450, 1, 121101, 3, 0, 2, "きゃる", 7, 0, 0, 0, 0, "2024/02/29 11:59:59", 42);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ラビリスタ（オーバーロード）", 121201, 260, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, 6, "2023/11/16 15:00:00", 121201, 1.55, 121201, 450, 1, 121201, 1, 0, 1, "らびりすた", 4, 0, 0, 0, 0, "2030/12/31 15:00:00", 40);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クルミ（ステージ）", 121301, 731, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 3, "2022/03/03 19:00:00", 121301, 1.9, 121301, 450, 0, 121301, 3, 0, 1, "くるみ", 3, 0, 0, 0, 0, "2030/12/31 15:00:00", 3);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミサキ（ステージ）", 121401, 742, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 15, "2022/03/15 15:00:00", 121401, 2.27, 121401, 450, 0, 121401, 3, 0, 2, "みさき", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アユミ（怪盗）", 121501, 590, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, 12, "2024/04/12 12:00:00", 121501, 2.0, 121501, 450, 1, 121501, 3, 0, 1, "あゆみ", 6, 0, 0, 0, 0, "2024/04/15 14:59:59", 6);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イノリ（怪盗）", 121601, 292, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 17, "2022/04/15 15:00:00", 121601, 1.425, 121601, 450, 0, 121601, 3, 0, 1, "いのり", 3, 0, 0, 0, 0, "2030/12/31 15:00:00", 3);
