INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アンナ（パイレーツ）", 121901, 293, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, 12, "2022/05/15 15:00:00", 121901, 2.125, 121901, 450, 0, 121901, 3, 0, 2, "あんな", 5, 0, 0, 0, 0, "2030/12/31 15:00:00", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シノブ（パイレーツ）", 122001, 380, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, 14, "2022/05/03 19:00:00", 122001, 1.425, 122001, 450, 0, 122001, 3, 0, 1, "しのぶ", 3, 0, 0, 0, 0, "2030/12/31 15:00:00", 3);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アオイ（キャンプ）", 122101, 731, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 0, 9, "2024/04/18 15:00:00", 122101, 1.97, 122101, 450, 1, 122101, 1, 0, 1, "あおい", 35, 0, 0, 0, 0, "2030/12/31 15:00:00", 35);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユカリ（キャンプ）", 122201, 419, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, 8, "2022/05/31 12:00:00", 122201, 1.84, 122201, 450, 0, 122201, 3, 0, 1, "ゆかり", 4, 0, 0, 0, 0, "2030/12/31 15:00:00", 4);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヴァンピィ", 122301, 564, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, 0, "2022/06/15 15:00:00", 122301, 1.425, 122301, 450, 0, 122301, 3, 0, 2, "うぁんぴぃ", 43, 0, 0, 0, 0, "2030/12/31 15:00:00", 43);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヒヨリ（サマー）", 122401, 264, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 0, 8, "2024/06/17 15:00:00", 122401, 2.42, 122401, 450, 1, 122401, 1, 0, 1, "ひより", 1, 0, 0, 0, 0, "2030/12/31 15:00:00", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("レイ（サマー）", 122501, 250, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 0, 0, "2023/07/12 12:00:00", 122501, 1.965, 122501, 450, 1, 122501, 3, 0, 1, "れい", 4, 0, 0, 0, 0, "2023/07/15 14:59:59", 4);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユイ（サマー）", 122601, 554, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, 0, "2022/07/15 15:00:00", 122601, 2.27, 122601, 450, 0, 122601, 3, 0, 2, "ゆい", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キョウカ（サマー）", 122701, 812, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, 0, "2022/08/15 15:00:00", 122701, 1.92, 122701, 450, 0, 122701, 3, 0, 2, "きょうか", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミソギ（サマー）", 122801, 237, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 0, 0, "2024/07/16 15:00:00", 122801, 2.295, 122801, 450, 1, 122801, 1, 0, 1, "みそぎ", 1, 0, 0, 0, 0, "2030/12/31 15:00:00", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミミ（サマー）", 122901, 361, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 0, 0, "2023/08/09 12:00:00", 122901, 2.25, 122901, 450, 1, 122901, 3, 0, 1, "みみ", 5, 0, 0, 0, 0, "2023/08/12 11:59:59", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アメス", 123001, 746, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 0, 0, "2024/06/30 12:00:00", 123001, 2.27, 123001, 450, 1, 123001, 3, 0, 2, "あめす", 44, 0, 0, 0, 0, "2024/07/03 18:59:59", 44);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マホ（エクスプローラー）", 123101, 793, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, 0, "2022/09/03 19:00:00", 123101, 1.795, 123101, 450, 0, 123101, 3, 0, 2, "まほ", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アヤネ（エクスプローラー）", 123201, 256, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, 0, "2022/09/15 15:00:00", 123201, 1.425, 123201, 450, 0, 123201, 3, 0, 1, "あやね", 3, 0, 0, 0, 0, "2030/12/31 15:00:00", 3);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネア", 123301, 350, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, 0, "2023/09/12 12:00:00", 123301, 1.62, 123301, 450, 1, 123301, 3, 0, 1, "ねあ", 1, 0, 0, 0, 0, "2023/09/15 14:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジュン（キャンプ）", 0, 0, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 123401, 0, 0, 123401, 3, 0, 0, "じゅん", 5, 0, 0, 0, 0, "2030/12/31 15:00:00", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リン（ハロウィン）", 123501, 583, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 0, 0, "2022/09/30 12:00:00", 123501, 2.34, 123501, 450, 1, 123501, 1, 0, 1, "りん", 6, 0, 0, 1, 0, "2030/12/31 15:00:00", 6);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("トモ（ハロウィン）", 123601, 262, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 0, 0, "2023/10/10 12:00:00", 123601, 1.965, 123601, 450, 1, 123601, 3, 0, 1, "とも", 4, 0, 0, 0, 0, "2023/10/15 14:59:59", 4);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ナナカ（ハロウィン）", 123701, 741, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, 0, "2022/10/15 15:00:00", 123701, 2.07, 123701, 450, 0, 123701, 3, 0, 2, "ななか", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 21);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クリスティーナ（ワイルド）", 123801, 238, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 0, 0, "2023/11/10 12:00:00", 123801, 2.295, 123801, 450, 1, 123801, 3, 0, 1, "くりすてぃーな", 1, 0, 0, 0, 0, "2023/11/15 14:59:59", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マツリ（ワイルド）", 123901, 183, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, 0, "2022/11/15 15:00:00", 123901, 2.125, 123901, 450, 0, 123901, 3, 0, 1, "まつり", 2, 0, 0, 0, 0, "2030/12/31 15:00:00", 2);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アカリ（クリスマス）", 124001, 438, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 0, 0, "2023/12/11 12:00:00", 124001, 2.07, 124001, 450, 1, 124001, 3, 0, 2, "あかり", 7, 0, 0, 0, 0, "2023/12/15 14:59:59", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヨリ（クリスマス）", 124101, 433, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 0, 0, "2022/11/30 12:00:00", 124101, 1.965, 124101, 450, 1, 124101, 1, 0, 2, "より", 6, 0, 0, 1, 0, "2030/12/31 15:00:00", 6);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジュン（クリスマス）", 124201, 144, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, 0, "2022/12/23 12:00:00", 124201, 2.07, 124201, 450, 0, 124201, 3, 0, 1, "じゅん", 5, 0, 0, 0, 0, "2030/12/31 15:00:00", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アン（アン＆グレア）", 0, 577, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 124301, 0, 1, 124301, 3, 0, 0, "あん", 0, 0, 0, 1, 181001, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("グレア（アン＆グレア）", 0, 577, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 124401, 0, 1, 124401, 3, 0, 0, "ぐれあ", 0, 0, 0, 1, 181001, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ホマレ（ニューイヤー）", 124501, 707, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 0, 0, "2024/01/12 12:00:00", 124501, 2.07, 124501, 450, 1, 124501, 3, 0, 2, "ほまれ", 7, 0, 0, 0, 0, "2024/01/15 14:59:59", 21);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミサト（ニューイヤー）", 124601, 698, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 0, 0, "2024/01/12 12:00:00", 124601, 2.44, 124601, 450, 1, 124601, 3, 0, 2, "みさと", 7, 0, 0, 0, 0, "2024/01/15 14:59:59", 21);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミツキ（ニューイヤー）", 124701, 590, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 0, 0, "2022/12/31 12:00:00", 124701, 2.24, 124701, 450, 1, 124701, 1, 0, 1, "みつき", 7, 0, 0, 1, 0, "2030/12/31 15:00:00", 46);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ノゾミ（リベレイター）", 124801, 423, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, 0, "2024/02/12 12:00:00", 124801, 2.14, 124801, 450, 1, 124801, 3, 0, 1, "のぞみ", 4, 0, 0, 0, 0, "2024/02/14 23:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カヤ（リベレイター）", 124901, 170, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, 0, "2023/01/31 12:00:00", 124901, 1.965, 124901, 450, 1, 124901, 1, 0, 1, "かや", 1, 0, 0, 1, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ムイミ（リベレイター）", 125001, 221, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, 0, "2024/02/12 12:00:00", 125001, 1.965, 125001, 450, 1, 125001, 3, 0, 1, "むいみ", 5, 0, 0, 0, 0, "2024/02/14 23:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("タマキ（カフェ）", 125101, 825, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, 0, "2023/03/03 19:00:00", 125101, 2.24, 125101, 450, 0, 125101, 3, 0, 1, "たまき", 8, 0, 0, 0, 0, "2030/12/31 15:00:00", 47);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("モニカ（カフェ）", 125201, 463, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, 0, "2023/03/10 12:00:00", 125201, 1.965, 125201, 450, 0, 125201, 3, 0, 1, "もにか", 4, 0, 0, 0, 0, "2030/12/31 15:00:00", 4);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("コッコロ（レンジャー）", 125301, 752, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 0, 0, "2024/04/12 12:00:00", 125301, 2.07, 125301, 450, 1, 125301, 3, 0, 1, "こっころ", 6, 0, 0, 0, 0, "2024/04/15 14:59:59", 6);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シオリ（レンジャー）", 125401, 710, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, 0, "2023/04/10 12:00:00", 125401, 2.09, 125401, 450, 0, 125401, 3, 0, 1, "しおり", 8, 0, 0, 0, 0, "2030/12/31 15:00:00", 8);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジータ（ウォーロック）", 125501, 443, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 0, 0, "2024/05/10 12:00:00", 125501, 1.92, 125501, 450, 1, 125501, 3, 0, 2, "じーた", 7, 0, 0, 0, 0, "2024/05/15 14:59:59", 50);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ビカラ", 125601, 267, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, 0, "2024/05/10 12:00:00", 125601, 2.09, 125601, 450, 1, 125601, 3, 0, 1, "びから", 51, 0, 0, 0, 0, "2024/05/15 14:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カリン（アルケミスト）", 125701, 579, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 0, 0, "2023/04/30 12:00:00", 125701, 2.24, 125701, 450, 1, 125701, 1, 0, 2, "かりん", 7, 0, 0, 1, 0, "2030/12/31 15:00:00", 9);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リリ（フォールン）", 125801, 464, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 0, "2023/04/17 12:00:00", 125801, 2.09, 125801, 450, 0, 125801, 3, 0, 1, "りり", 3, 0, 0, 0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カヤ（リベレイター）", 0, 0, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 125901, 0, 1, 125901, 3, 0, 0, "かや", 1, 0, 0, 0, 0, "2030/12/31 15:00:00", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クリア（フォールン）", 126001, 406, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, "2023/10/31 12:00:00", 126001, 2.09, 126001, 450, 0, 126001, 3, 0, 1, "くりあ", 0, 0, 0, 0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("プレシア（フォールン）", 126101, 480, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, 0, "2023/11/15 15:00:00", 126101, 2.09, 126101, 450, 0, 126101, 3, 0, 2, "ぷれしあ", 44, 0, 0, 0, 0, "2030/12/31 15:00:00", 53);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イリヤ（儀装束）", 126201, 568, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 0, 0, "2024/06/10 12:00:00", 126201, 2.09, 126201, 450, 1, 126201, 3, 0, 2, "いりや", 3, 0, 0, 0, 0, "2024/06/15 14:59:59", 3);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユキ（儀装束）", 126301, 456, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, 0, "2023/06/15 15:00:00", 126301, 2.07, 126301, 450, 0, 126301, 3, 0, 2, "ゆき", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 9);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クローチェ", 126401, 373, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 0, 0, "2024/06/30 12:00:00", 126401, 2.09, 126401, 450, 1, 126401, 3, 0, 1, "くろーちぇ", 1, 0, 0, 0, 0, "2024/07/03 18:59:59", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ライラエル", 126501, 740, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, 0, "2024/06/30 12:00:00", 126501, 1.965, 126501, 450, 1, 126501, 3, 0, 2, "らいらえる", 7, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネネカ（サマー）", 126601, 650, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 0, 0, "2024/07/11 12:00:00", 126601, 2.04, 126601, 450, 1, 126601, 3, 0, 2, "ねねか", 7, 0, 0, 0, 0, "2024/07/15 14:59:59", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アキノ（サマー）", 126701, 224, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 0, 0, "2023/06/30 12:00:00", 126701, 1.965, 126701, 450, 1, 126701, 1, 0, 1, "あきの", 5, 0, 0, 1, 0, "2030/12/31 15:00:00", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユカリ（サマー）", 126801, 159, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, 0, "2023/07/15 15:00:00", 126801, 1.97, 126801, 450, 0, 126801, 3, 0, 1, "ゆかり", 5, 0, 0, 0, 0, "2030/12/31 15:00:00", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ランファ（サマー）", 126901, 682, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 0, 0, "2024/08/09 12:00:00", 126901, 1.965, 126901, 450, 1, 126901, 3, 0, 2, "らんふぁ", 7, 0, 0, 0, 0, "2024/08/12 11:59:59", 21);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クウカ（サマー）", 127001, 133, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 0, 0, "2023/07/31 12:00:00", 127001, 1.97, 127001, 450, 1, 127001, 1, 0, 1, "くうか", 2, 0, 0, 1, 0, "2023/08/14 20:59:59", 52);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シノブ（サマー）", 127101, 255, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 0, 0, "2024/08/09 12:00:00", 127101, 2.09, 127101, 450, 1, 127101, 3, 0, 1, "しのぶ", 5, 0, 0, 0, 0, "2024/08/12 11:59:59", 46);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キャル（編入生）", 127201, 804, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 0, 0, "2024/03/28 12:00:00", 127201, 2.09, 127201, 450, 1, 127201, 3, 0, 2, "きゃる", 7, 0, 0, 0, 0, "2024/03/31 11:59:59", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("スズナ（編入生）", 127301, 750, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, 0, "2023/09/15 15:00:00", 127301, 2.09, 127301, 450, 0, 127301, 3, 0, 1, "すずな", 8, 0, 0, 0, 0, "2030/12/31 15:00:00", 8);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ビカラ（コラボ）", 0, 0, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 127401, 0, 1, 127401, 3, 0, 0, "びから", 1, 0, 0, 0, 0, "2030/12/31 15:00:00", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("サレン（サラサリア）", 127501, 304, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 0, 0, "2024/04/26 12:00:00", 127501, 2.09, 127501, 450, 1, 127501, 3, 0, 1, "されん", 4, 0, 0, 0, 0, "2024/04/30 11:59:59", 4);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ルカ（サラサリア）", 127601, 157, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, 0, "2023/10/15 15:00:00", 127601, 1.965, 127601, 450, 0, 127601, 3, 0, 1, "るか", 4, 0, 0, 0, 0, "2030/12/31 15:00:00", 4);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ペコリーヌ（クリスマス）", 127901, 372, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 0, 0, "2024/05/27 12:00:00", 127901, 1.965, 127901, 450, 1, 127901, 3, 0, 2, "ぺこりーぬ", 5, 0, 0, 0, 0, "2024/05/31 11:59:59", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クレジッタ（クリスマス）", 128001, 723, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, 0, "2023/12/15 15:00:00", 128001, 2.09, 128001, 450, 0, 128001, 3, 0, 1, "くれじった", 35, 0, 0, 0, 0, "2030/12/31 15:00:00", 35);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シズル（シズル&リノ）", 0, 580, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 128101, 0, 1, 128101, 3, 0, 0, "しずる", 0, 0, 0, 1, 181101, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リノ（シズル&リノ）", 0, 580, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 128201, 0, 1, 128201, 3, 0, 0, "りの", 0, 0, 0, 1, 181101, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イノリ（ニューイヤー）", 128301, 191, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 0, 0, "2023/12/31 12:00:00", 128301, 2.09, 128301, 450, 1, 128301, 1, 0, 1, "いのり", 3, 0, 0, 1, 0, "2030/12/31 15:00:00", 38);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ハツネ（ニューイヤー）", 128401, 801, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, 0, "2024/06/26 12:00:00", 128401, 2.09, 128401, 450, 1, 128401, 3, 0, 2, "はつね", 7, 0, 0, 0, 0, "2024/06/30 11:59:59", 21);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カスミ（ニューイヤー）", 128501, 739, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, 0, "2024/06/26 12:00:00", 128501, 2.09, 128501, 450, 1, 128501, 3, 0, 2, "かすみ", 7, 0, 0, 0, 0, "2024/06/30 11:59:59", 21);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リリ（フォールン）", 0, 0, "", 0, 0, "2015/04/01 15:00:00", 0, 0.0, 128601, 0, 1, 128601, 3, 0, 0, "りり", 1, 0, 0, 0, 0, "2030/12/31 15:00:00", 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヒヨリ（アストラル）", 128701, 226, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 0, "2024/08/12 12:00:00", 128701, 2.09, 128701, 450, 1, 128701, 3, 0, 1, "ひより", 1, 0, 0, 0, 0, "2024/08/15 14:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("レイ（アストラル）", 128801, 194, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 0, "2024/01/31 12:00:00", 128801, 1.965, 128801, 450, 1, 128801, 1, 0, 1, "れい", 4, 0, 0, 1, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユイ（アストラル）", 128901, 772, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 0, "2024/08/12 12:00:00", 128901, 2.09, 128901, 450, 1, 128901, 3, 0, 2, "ゆい", 7, 0, 0, 0, 0, "2024/08/15 14:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("エリス", 129001, 800, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 0, "2024/06/30 12:00:00", 129001, 2.09, 129001, 450, 1, 129001, 3, 0, 2, "えりす", 7, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユニ（ウィンター）", 129301, 708, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 0, 0, "2024/03/03 19:00:00", 129301, 2.09, 129301, 450, 1, 129301, 3, 0, 1, "ゆに", 7, 0, 0, 0, 0, "2024/03/11 11:59:59", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クロエ（ウィンター）", 129401, 188, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, 0, "2024/03/18 12:00:00", 129401, 2.09, 129401, 450, 0, 129401, 3, 0, 1, "くろえ", 2, 0, 0, 0, 0, "2030/12/31 15:00:00", 2);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アネモネ", 129601, 550, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 0, "2024/06/30 12:00:00", 129601, 2.09, 129601, 450, 1, 129601, 3, 0, 1, "あねもね", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネフィ＝ネラ", 129701, 540, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 0, "2024/06/30 12:00:00", 129701, 2.09, 129701, 450, 1, 129701, 3, 0, 1, "ねふぃーねら", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マコト（コマンダー）", 129801, 269, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 0, 0, "2024/03/31 12:00:00", 129801, 2.09, 129801, 450, 1, 129801, 3, 0, 1, "まこと", 5, 0, 0, 0, 0, "2024/04/12 11:59:59", 5);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("エリコ（コマンダー）", 129901, 294, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, 0, "2024/04/15 15:00:00", 129901, 1.84, 129901, 450, 0, 129901, 3, 0, 1, "えりこ", 6, 0, 0, 0, 0, "2030/12/31 15:00:00", 48);
