INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キョウカ（スプリング）", 130701, 563, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 0, 0, "2024/05/03 19:00:00", 130701, 1.92, 130701, 450, 1, 130701, 3, 0, 2, "きょうか", 7, 0, 0, 0, 0, "2024/05/15 14:59:59", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("スズメ（スプリング）", 130801, 558, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, 0, "2024/05/15 15:00:00", 130801, 1.84, 130801, 450, 0, 130801, 3, 0, 2, "すずめ", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クルル", 130901, 440, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, 0, "2024/06/15 15:00:00", 130901, 2.09, 130901, 450, 0, 130901, 3, 0, 2, "くるる", 7, 0, 0, 0, 0, "2030/12/31 15:00:00", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マホ（ドリームパーク）", 131001, 702, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 0, 0, "2024/05/31 12:00:00", 131001, 1.84, 131001, 450, 1, 131001, 3, 0, 2, "まほ", 7, 0, 0, 0, 0, "2024/06/10 11:59:59", 7);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネア（サマー）", 131101, 165, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, 0, "2024/06/30 12:00:00", 131101, 2.09, 131101, 450, 0, 131101, 3, 0, 1, "ねあ", 2, 0, 0, 0, 0, "2030/12/31 15:00:00", 52);
