INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジータ", 170101, 245, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 0, 4, "2015/04/01 15:00:00", 105701, 1.965, 170101, 450, 0, 170101, 3, 0, 1, "じーた", 34, 0, 0, 0, 0, "2030/12/31 15:00:00", 34);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヒヨリ（プリンセス）", 180101, 199, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 0, 7, "2024/06/30 12:00:00", 180101, 1.62, 180101, 450, 1, 180101, 3, 0, 1, "ひより", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユイ（プリンセス）", 180201, 767, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 0, 1, "2024/06/30 12:00:00", 180201, 1.92, 180201, 450, 1, 180201, 3, 0, 2, "ゆい", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("レイ（プリンセス）", 180301, 377, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 0, 7, "2024/06/30 12:00:00", 180301, 1.965, 180301, 450, 1, 180301, 3, 0, 1, "れい", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ペコリーヌ（プリンセス）", 180401, 155, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 0, 1, "2024/06/30 12:00:00", 180401, 1.965, 180401, 450, 1, 180401, 3, 0, 1, "ぺこりーぬ", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("コッコロ（プリンセス）", 180501, 555, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 0, 1, "2024/06/30 12:00:00", 180501, 2.14, 180501, 450, 1, 180501, 3, 0, 1, "こっころ", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キャル（プリンセス）", 180601, 747, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 0, 1, "2024/06/30 12:00:00", 180601, 1.92, 180601, 450, 1, 180601, 3, 0, 2, "きゃる", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ハツネ＆シオリ", 180701, 732, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 0, 1, "2024/06/30 12:00:00", 180701, 1.75, 180701, 450, 1, 180701, 3, 0, 1, "はつねしおり", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミソギ＆ミミ＆キョウカ", 180801, 465, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 0, 1, "2024/06/30 12:00:00", 180801, 1.5, 180801, 450, 1, 180801, 3, 0, 1, "みそぎみみきょうか", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アキノ＆サレン", 180901, 421, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 0, 1, "2024/06/30 12:00:00", 180901, 2.09, 180901, 450, 1, 180901, 3, 0, 1, "あきのされん", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アン＆グレア", 181001, 577, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 0, 1, "2024/06/30 12:00:00", 181001, 2.09, 181001, 450, 1, 181001, 3, 0, 2, "あんぐれあ", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シズル＆リノ", 181101, 551, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 0, 1, "2024/06/30 12:00:00", 181101, 1.92, 181101, 450, 1, 181101, 3, 0, 1, "しずるりの", 0, 0, 0, 0, 0, "2024/07/03 18:59:59", 0);
